import './Img.css';
import Media from 'react-media';

// Image dollasr view
export default function ReturnImg(props) {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall img={props.img} />}
     {matches.medium && <ScreenLarge img={props.img} />}
     {matches.large && <ScreenLarge img={props.img} />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = (props) => (
 <div className='wrp-img-money-dash'>
  <img src={props.img} alt={'logo img dollars'} />
 </div>
);
export const ScreenSmall = (props) => (
 <div className='wrp-img-money-dash-sm'>
  <img src={props.img} alt={'logo img dollars'} />
 </div>
);
